import React, { Component } from "react";
import RoboCard from "./RoboCard";
import {robots} from "./robots";
import Searchbox from "./Searchbox";


class App extends Component {
	constructor() {
		super();
		this.state = {
			robots: robots,
			searchtext:""
		}
	}

	onSearchChange(event) {
		console.log(event);
	}

	render() {
		return (
		<div className="tc">
			<h1>Hello</h1>
			<Searchbox searchcahnge={this.onSearchChange} />
			<RoboCard robots={this.state.robots}/>
		</div>
	);
	}
}

export default App;
